class ProvidersSrv{
    data = new Array<IProvider>();

    private static entity: ProvidersSrv | undefined;

    static getInstance(){
        if(this.entity == undefined){
            this.entity = new ProvidersSrv();
        }
        return this.entity
    }

    async get(){
        try {
            const response = await fetch(url + "/providers", {
            method: 'GET', 
            mode: 'cors', 
            cache: 'no-cache', 
            }); 

        let data = await response.json()
        this.data=data
        return data
        } catch (error) {
            return this.data
        }
    }

    async getId(id: string){
        try {
            const response = await fetch(url + "/providers/" + id, {
            method: 'GET', 
            mode: 'cors', 
            cache: 'no-cache', 
            }); 

        let data = await response.json()

        return data
        } catch (error) {
            return this.data
        }
    }

    async add(d: IProvider){
        d.id_user = -1
        try {
            fetch(url + "/providers", {
            method: 'POST', 
            body: JSON.stringify(d),
            headers:{
                'Content-Type': 'application/json'
              }
            }); 
        } catch (error) {
            console.log(error)
        }
    }

    async remove(id: string){
        try {
            const response = await fetch(url + "/providers/" + id, {
            method: 'DELETE', 
            mode: 'cors', 
            }); 

        } catch (error) {
            console.log(error)
        }
    }

    async edit(id: string, d: IProvider){
        for (let i = 0; i < this.data.length; i++) {
            const el = this.data[i];
            if(el.id == id){
                this.data[i] = d;
            }
        }
    }
}

